class FrameAnimation extends StatefulWidget {
  final List<Widget> animationWidget;
  final double width;
  final double height;
  final int interval;

  const FrameAnimation({Key key, @required this.animationWidget, this.width, this.height, this.interval = 66})
      : super(key: key);

  @override
  State<StatefulWidget> createState() {
    return new _FrameAnimationState();
  }
}

class _FrameAnimationState extends State<FrameAnimation> with SingleTickerProviderStateMixin, AutomaticKeepAliveClientMixin {
  Animation<double> _animation;
  AnimationController _controller;

  @override
  void initState() {
    super.initState();

    final int imageCount = widget.animationWidget.length;
    final int maxTime = widget.interval * imageCount;

    _controller = new AnimationController(vsync: this, duration: Duration(milliseconds: maxTime));
    _controller.addStatusListener((AnimationStatus status) {
      if (status == AnimationStatus.completed) {
        _controller.forward(from: 0.0);
      }
    });

    _animation = new Tween<double>(begin: 0, end: imageCount.toDouble()).animate(_controller)
      ..addListener(() {
        setState(() {});
      });
    _controller.forward();
  }

  @override
  void dispose() {
    _controller.dispose();
    super.dispose();
  }

  @override
  Widget build(BuildContext context) {
    int index = _animation.value.floor() % widget.animationWidget.length;

    List<Widget> images = [];
    for (int i = 0; i < widget.animationWidget.length; ++i) {
      if (i != index) {
        images.add(Container(
          width: 0,
          height: 0,
          child: widget.animationWidget[i],
        ));
      }
    }


    images.add(Container(
      width: widget.width,
      height: widget.height,
      child: widget.animationWidget[index],
    ));

    return Stack(alignment: AlignmentDirectional.center, children: images);
  }

  @override
  bool get wantKeepAlive => true;
}
